import{o as n,c as s,f as a}from"./app.222ca5d5.js";const t='{"title":"类数组的[].slice.call和Array.prototype.slice.call有什么区别","description":"测试一下[].slice.call和Array.prototype.slice.call比较","frontmatter":{"date":"2021-09-04","title":"类数组的[].slice.call和Array.prototype.slice.call有什么区别","tags":["js","性能"],"description":"测试一下[].slice.call和Array.prototype.slice.call比较"},"headers":[{"level":2,"title":"简单测试","slug":"简单测试"},{"level":2,"title":"资料","slug":"资料"}],"relativePath":"posts/js_slice.md","lastUpdated":1631851087164}',p={},o=[a('<h1 id="类数组的-slice-call和array-prototype-slice-call有什么区别"><a class="header-anchor" href="#类数组的-slice-call和array-prototype-slice-call有什么区别" aria-hidden="true">#</a> 类数组的[].slice.call和Array.prototype.slice.call有什么区别</h1><p>做一个不是很全面的测试，先说结论</p><ul><li>两者是同一个东西 比如 [].slice===Array.prototype.slice //true</li><li>写法不一样，会对性能有多大的影响， 毕竟[]是要初始化一个对象</li><li>如果担心第二条 完全一个保存在一个变量里面 let slicee = [].slice</li><li>写法的不同基本不可能成为你的程序的性能瓶颈</li><li><strong>github上面[].slice的写法数量远大于proto的写法</strong></li><li>怎么写的爽就怎么写，肯定是前者写的更快</li></ul><h2 id="简单测试"><a class="header-anchor" href="#简单测试" aria-hidden="true">#</a> 简单测试</h2><div class="language-js"><pre><code><span class="token keyword">let</span> o <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token number">0</span><span class="token operator">:</span> <span class="token string">&quot;node&quot;</span><span class="token punctuation">,</span> <span class="token number">1</span><span class="token operator">:</span> <span class="token string">&quot;ts&quot;</span><span class="token punctuation">,</span> <span class="token number">2</span><span class="token operator">:</span> <span class="token string">&quot;java&quot;</span><span class="token punctuation">,</span> <span class="token number">3</span><span class="token operator">:</span> <span class="token string">&quot;js&quot;</span><span class="token punctuation">,</span> <span class="token number">4</span><span class="token operator">:</span> <span class="token string">&quot;python&quot;</span><span class="token punctuation">,</span> length<span class="token operator">:</span> <span class="token number">5</span><span class="token punctuation">}</span>\n\nconsole<span class="token punctuation">.</span><span class="token function">time</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n<span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> i <span class="token operator">=</span> <span class="token number">0</span><span class="token punctuation">;</span> i <span class="token operator">&lt;</span> <span class="token number">2</span><span class="token punctuation">;</span> i<span class="token operator">++</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">.</span><span class="token function">slice</span><span class="token punctuation">.</span><span class="token function">call</span><span class="token punctuation">(</span>o<span class="token punctuation">,</span> <span class="token number">1</span><span class="token punctuation">)</span>\n<span class="token punctuation">}</span>\nconsole<span class="token punctuation">.</span><span class="token function">timeEnd</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n\nconsole<span class="token punctuation">.</span><span class="token function">time</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n<span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> i <span class="token operator">=</span> <span class="token number">0</span><span class="token punctuation">;</span> i <span class="token operator">&lt;</span> <span class="token number">1000000</span><span class="token punctuation">;</span> i<span class="token operator">++</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token class-name">Array</span><span class="token punctuation">.</span>prototype<span class="token punctuation">.</span><span class="token function">slice</span><span class="token punctuation">.</span><span class="token function">call</span><span class="token punctuation">(</span>o<span class="token punctuation">,</span> <span class="token number">1</span><span class="token punctuation">)</span>\n<span class="token punctuation">}</span>\nconsole<span class="token punctuation">.</span><span class="token function">timeEnd</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n</code></pre></div><p>在node环境和chrome的控制台，两个都不分伯仲；<br> 另一个有意思的发现是单独执行平均值基本一致<br> 两个在一起执行，谁在后面谁慢</p><h2 id="资料"><a class="header-anchor" href="#资料" aria-hidden="true">#</a> 资料</h2><p>将近10年前的文章，可能现在V8 优化的更好，更没必要纠结了 有一个jsrf的文章被到处引用，可惜这个网站已经挂掉了，不知道里面写了什么 <a href="https://stackoverflow.com/questions/9006553/slice-or-array-prototype-slice" target="_blank" rel="noopener noreferrer">https://stackoverflow.com/questions/9006553/slice-or-array-prototype-slice</a></p>',8)];p.render=function(a,t,p,e,c,l){return n(),s("div",null,o)};export{t as __pageData,p as default};
